INSERT INTO `noticia` (`idNoticia`, `TituloNoticia`, `ConteúdoNoticia`, `ImagemNoticia`) VALUES
(3, 'Presidentes da Venezuela e Guiana se reunirão para discutir Essequibo, e Lula é convidado para encontro', 'Os presidentes da Venezuela, Nicolás Maduro, e da Guiana, Irfaan Ali, se reunirão na semana que vem para debater a disputa sobre Essequibo - a região da Guiana que a Venezuela alega ser sua e cuja anexação aprovou em referendo no domingo (3).\r\n\r\nO presidente Luiz Inácio Lula da Silva foi convidado para o encontro para atuar como observador, segundo o governo guianês.\r\n\r\n✅ Clique aqui para seguir o canal de notícias internacionais do g1 no WhatsApp\r\nA reunião acontecerá na quinta-feira (14) em São Vicente e Granadinas, país do Caribe, segundo informou o governo local. O primeiro-ministro do país, Ralph Gonsalves, também tem atuado como intermediador no conflito e falou ao telefone com Maduro e Ali neste sábado (9).', 'maduroGuiana.png'),
(4, 'Zé Neto fala sobre acidente em rodovia: \'Do carro, não sobrou nada. Mas estamos aqui inteiros, um pouquinho machucados\'', 'O cantor Zé Neto, da dupla com Cristiano, deu uma entrevista exclusiva para o repórter Mauricio Ferraz após o acidente na BR-153. Internado no Hospital de Base de São José do Rio Preto (SP), ele falou sobre a recuperação.\r\n\r\n\"Graças a Deus, só o susto mesmo e os aprendizados da vida. Com certeza, é mais uma data para se comemorar e mais uma data de nascimento, que vai ficar marcada para o resto da vida. Do carro, não sobrou nada. Mas estamos aqui inteiros, intactos. Um pouquinho machucados. Mas logo, logo de volta aos palcos para levar música e levar alegria, que é o que a gente sabe fazer\", disse o cantor.', 'zeNetoAcidente.png'),
(5, 'Mega-Sena, concurso 2.666: aposta de Mariana (MG) ganha sozinha mais de R$ 30 milhões', 'O concurso 2.666 da Mega-Sena foi realizado na noite deste sábado (9), em São Paulo. Uma aposta de Mariana, em Minas Gerais, acertou as seis dezenas e ganhou sozinha o prêmio de R$ 30.781.665,32.\r\n\r\nVeja os números sorteados: 05 - 25 - 29 - 30 - 43 - 47.\r\n\r\nDe acordo com a Caixa Econômica Federal, o vencedor fez uma aposta simples, de seis números, na Lotérica Marianense.\r\n\r\n5 acertos - 70 apostas ganhadoras: R$ 43.157,02.\r\n4 acertos - 4.455 apostas ganhadoras: R$ 968,73.\r\nNo sábado, também foi realizado o sorteio da +Milionária, cujo prêmio pode chegar a R$ 107 milhões. Veja o resultado.', 'mega30mi.png'),
(6, 'Professora larga a sala de aula para investir em salgados e fatura R$ 470 mil por mês', 'A professora Priscila Figueiredo decidiu largar a sala de aula para empreender. Ela começou seu negócio fazendo coxinha em casa, com dinheiro emprestado. Depois, a empresária mudou a estratégia. Foi vender os salgados para pequenos comércios.\r\n\r\nCom isso, cresceu aos poucos. Errou, corrigiu, aprendeu na prática. Em 2017, a empresária montou uma fábrica em São Miguel Paulista, Zona Leste de São Paulo, e descobriu a importância da escala para o seu pequeno negócio.\r\n\r\nHoje, Priscila fornece 40 toneladas de salgados por mês para mais de 100 comércios. Ela produz coxinhas, quibes, croquetes e bolinhas de queijos.\r\n\r\nAlém da fábrica, a Priscila também investiu na abertura de lojas físicas para vender os salgados. Hoje, ela comanda uma rede com quatro unidades próprias, duas franqueadas e seis licenciadas.\r\n\r\nO negócio conta com uma simpática coxinha gigante, que é a mascote do negócio e desfila na rua para atrair clientes.\r\n\r\nO faturamento mensal da fábrica de salgados da Priscila é de R$ 270 mil. Já as quatro unidades próprias, juntas, faturam R$ 200 mil por mês.', 'salgados.png');
